import SectionHeader from "../Atomics/SectionHeader/SectionHeader";
import {
	VerifiedTooltip,
	UnverifiedTooltip,
} from "../Atomics/CustomCheckTooltips/CustomCheckTooltips";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
	faPlayCircle,
	faEllipsisV,
	faCalendarAlt,
} from "@fortawesome/free-solid-svg-icons";

const VideoProduct = ({
	imgAlt = "",
	imgSrc,
	videoTitle,
	videoCategory,
	views,
	timeAgo,
	videoHref = "#",
	time,
	active = null,
	verified = false,
	product
}) => {
	const activeStatus = active
		? "video-card video-card-list active"
		: "video-card video-card-list";
	const categoryClass = verified
		? "video-page text-success-custom"
		: "video-page text-danger-custom";
	return (
		<>
		{
			console.log(product)
		}
			<div className={activeStatus}>
				<div className="video-card-image">
					 
					<a href="#">
						<img className="img-fluid" src={product.images[0].src} alt={imgAlt} />
					</a>
				 
				</div>

				<div className="video-card-body">
					

					<div className="video-title">
						<a>{product.name}</a>
					</div>
					<div className={categoryClass}>
					 {product.categories.name}
					</div>
					<div className="video-view">
						{views} views &nbsp;
						<FontAwesomeIcon icon={faCalendarAlt} /> {timeAgo} ago
					</div>
				</div>
			</div>
		</>
	);
};

export default VideoProduct;
